div.p:
c
Token scan_token(Scanner* s) {
char c = advance(s);
if (!is_valid(c)) {
// HALTS ENTIRE PROCESS
fprintf(stderr, "Lex Error: %c", c);
exit(1);
}
return emit_token(s, c);
}

c
void scan_tokens(Scanner* s) {
while (!is_at_end(s)) {
s->start = s->current;
// scan_token() reports errors
// but does not halt the loop.
add_token(scan_token(s));
}
}
